import React from 'react'
import PropTypes from 'prop-types'

export class User extends React.Component {
    render() {
        const { name } = this.props
        return (
            <div>
                <p>Привет, {name}!</p>
            </div>
        )
    }
}

User.propTypes = {
    name: PropTypes.string.isRequired,
}
